function App() {
  return (
    <div>
      <div style={{position: "fixed", left: 0, top: "100px"}}>
        <Card>
          <CardContent>
            Hi
          </CardContent>
        </Card>
      </div>
      <div className="App">
        <Header />
      </div>
      <div>
        <Feed />
      </div>
    </div>
  );
}

export default App;
